import './'

const Hero = () => {
  return (
    <>
      <section class="jumbo-main">
      <div class="container">
        <div class="row">
          <div class="col-6 jumbo-content">
            <h1>Selamat Datang</h1>
            <h5>di website Praktikum Pemrograman Website</h5>
          </div>
        </div>
      </div>
    </section>
    </>
  );
};
export default Hero;
